import React from "react";

export default function About() {
  return (
    <section className="section about-section">
      <h1 className="section-title">about us</h1>
      <p>
      The company itself is a very successful company. The trouble of
      repudiating the architect that you receive in the offices, I will open to
      follow and endure them, but the elders, unless often someone here
      pursues us with hatred of the truth as if I were to explain the blinded
      and the pain? Is it pleasing to reason that the error of flattery is here
      spurred on?
      </p>
    </section>
  );
}
